import React from "react";
import './App.css'
const Nav = ()=>{
return(
    <div className="navbar">
       <div className="container">
       <ul>
       <a href = '#' className="logo">Logo</a>
       </ul>

       <a href = '/' className="logo-1">Home</a>
       <a href = '/about' className="logo-2">About</a> 
    </div>\
    </div>
)
}
export default Nav;
